import React, {useEffect} from "react";

const sportOptions = [
  {value:"Tennis", label:'Tennis'},
  {value:'Football', label:'Football'},
  {value:'Jogging', label:'Jogging'},
  {value:'Cycling', label:'Cycling'},
  {value:'Work out', label:'Work out'},
  {value:'Table Tennis', label:'Table Tennis'},
  {value:'Basketball', label:'Basketball'},
  {value:'Paintball', label:'Paintball'},
  {value:'Airsoft', label:'Airsoft'},
  {value:'Laser tag', label:'Laser tag'},
  {value:'Skiing', label:'Skiing'},
  {value:'Badminton', label:'Badminton'},
  {value:'Skating', label:'Skating'},
  {value:'Volleyball', label:'Volleyball'},
  {value:'Ice Skating', label:'Ice Skating'},
  {value:'Bowling', label:'Bowling'}
];

useEffect(() => {
  fetch()
},[])

export default sportOptions;
